import React from "react";
import "../styles/Home.css";
import ThreePerson from "../components/ThreePerson.js";

function HeroSection() {
  return (
    <section className="hero-section breed-style-bg">
      <div className="container breed-container">
        <div className="breed-content">
          {/* Left: Text */}
          <div className="breed-text-card animate-fadein">
            <span className="breed-kicker">HEY THERE!</span>
            <h1>
              I AM <span className="breed-highlight">TRẦN KHÁNH LINH</span>
            </h1>
            <p className="breed-subtitle">
              CREATIVE SOFTWARE ENGINEER & DESIGNER
            </p>
            <div className="breed-actions">
              <a href="/about" className="breed-btn breed-btn-main">
                Xem về tôi
              </a>
              <a href="/projects" className="breed-btn breed-btn-outline">
                Dự án
              </a>
            </div>

          </div>
        </div>
      </div>
    </section>
  );
}

export default HeroSection;
